(1, 1, '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Kunci proses entrepreneurial adalah ....</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Fleksibel</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Inovasi</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Optimis</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Kreatif</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Synthesis</span><br></p>', 'pilihan_b', 20, '2021-06-21 03:59:11', '2021-06-21 03:59:11'),
(2, 1, '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Tiga aspek lapangan yang membuat produk atau jasa lebih sesuai untuk industri kecil adalah ....</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Lokasi, pasar, proses</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Pasar, pelayanan, proses</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Proses, lokasi, transportasi</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Lokasi, transportasi, pasar</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Lokasi, transportasi</span><br></p>', 'pilihan_a', 20, '2021-06-21 04:06:06', '2021-06-21 04:06:06'),
(3, 1, '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Salah satu hambatan yang timbul terhadap intrapreneurship adalah ....</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Rencana jangka panjang</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Usaha yang difokuskan pada masalah rawan</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Solusi baru dijadikan bisnis utama</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Fakta diabaikan</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Solusi baru dijadikan bisnis utama</span><br></p>', 'pilihan_d', 30, '2021-06-21 04:08:05', '2021-06-21 04:08:05'),
(4, 1, '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Pakaian jadi, tas tangan wanita, dan dompet merupakan karakteristik produk</span><br style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\"><br style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\"><br style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\"><br style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\"><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Proses manufaktur yang bisa dipisah</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Industri presisi</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Asembling sederhana</span><br></p>', '<p><span style=\"color: rgb(87, 87, 87); font-family: Roboto, Arial, sans-serif;\">Produk yang beragam</span><br></p>', '<p>produk sama</p>', 'pilihan_d', 30, '2021-06-21 04:12:28', '2021-06-21 04:13:31'),
(5, 4, '<p>1*8</p>', '<p>7</p>', '<p>8</p>', '<p>6</p>', '<p>11</p>', '5', 'pilihan_b', NULL, '2021-06-21 05:01:46', '2021-06-21 05:01:46'),
(6, 4, '<p>4*5</p>', '<p>22</p>', '<p>21</p>', '<p>20</p>', '<p>28</p>', '<p><br></p>', 'pilihan_c', NULL, '2021-06-21 05:02:34', '2021-06-21 05:02:34'),
(7, 6, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Terciptanya teks proklamasi kemerdekaan RI merupakan bukti........</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">kesediaan berkorban dari golongan tua</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">adanya rasa persatuan dan rela berkorban antara golangan tua dan muda</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">adanya tekanan golongan muda atas golongan tua</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">kekhawatiran golongan muda atas sikap golongan tua yang berhati hati</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">kemenangan golongan muda atas golongan tua</span><br></p>', 'pilihan_b', NULL, '2021-06-21 06:00:32', '2021-06-21 06:00:32'),
(8, 6, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Tindakan pertama yang dilakukan para pemuda Indonesia setelah mendengar berita kekalahan Jepang adalah....</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">mengadakan rapat dengan pemimpin nasional menentukan tindakan selanjutnya</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">menemui golongan tua untuk menanyakan kebenaran berita tersebut</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">melakukan koordinasi dengan golongannya untuk melaksanakan proklamasi kemerdekaan</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">membentuk panitia kemerdekaan Indonesia</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">meminta Bung Karno dan Bung Hatta untuk segera memproklamasikan kemerdekaan</span><br></p>', 'pilihan_d', NULL, '2021-06-21 06:01:40', '2021-06-21 06:01:40'),
(10, 6, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Tujuan Jepang membentuk banyak organisasi militer dan semi militer dalam rangka Perang Asia Timur Raya, adalah....</span><span class=\"freebirdFormviewerComponentsQuestionBaseRequiredAsterisk\" id=\"i42\" aria-label=\"Required question\" style=\"color: rgb(217, 48, 37); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">&nbsp;</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">memperbaiki sistem mobilisasi massa</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">meraih simpati masyarakat Indonesia</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">menarik anggota di organisasi-organisasi bentukan Jepang</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">memperkuat angkatan perang Jepang</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">melatih rakyat Indonesia dalam kemiliteran</span><br></p>', 'pilihan_c', NULL, '2021-06-21 06:02:30', '2021-06-21 06:02:30'),
(11, 6, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Hal yang menguntungkan pada masa pendudukan Jepang dalam bidang pendidikan adalah ....</span><span class=\"freebirdFormviewerComponentsQuestionBaseRequiredAsterisk\" id=\"i61\" aria-label=\"Required question\" style=\"color: rgb(217, 48, 37); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">&nbsp;</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">melahirkan golongan cerdik pandai yang mempelopori gerakan nasional Indonesia</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">digunakannya bahasa Indonesia sebagai pengantar di Sekolah dan masyarakat</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">pendidikan di Indonesia diatur model pendidikan barat oleh pemerintah Jepang</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">melahirkan tokoh-tokoh di bidang pendidikan seperti Ki Hajar Dewantara</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">diajarkannya tulisan kanji dan hiragana di sekolah sekolah bentukan Jepang</span><br></p>', 'pilihan_b', NULL, '2021-06-21 06:03:21', '2021-06-21 06:03:21'),
(12, 6, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Yang dilakukan Jepang untuk menarik simpati bangsa Indonesia adalah....</span><span class=\"freebirdFormviewerComponentsQuestionBaseRequiredAsterisk\" id=\"i80\" aria-label=\"Required question\" style=\"color: rgb(217, 48, 37); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">&nbsp;</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">memberikan kemerdekaan pada bangsa Indonesia</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">memberikan kebebasan beragama bagi penduduk Indonesia</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">membawa kemakmuran bagi seluruh rakyat Indonesia</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">membebaskan bangsa Indonesia dari penjajah Eropa</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">meningkatkan pendidikan bangsa Indonesia</span><br></p>', 'pilihan_e', NULL, '2021-06-21 06:04:05', '2021-06-21 06:04:05'),
(15, 7, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Jika dilihat dari cara penyampaiannya kepada orang lain, jenis komunikasi dapat dibedakan menjadi tiga macam, yaitu ....</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Pengirim, media, dan penerima</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">komunikasi langsung, komunikasi tidak langsung, dan komunikasi melalui media</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">komunikasi daring, komunikasi luring dan komunikasi verbal</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">verbal, lisan, tulisan</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">visual</span><br></p>', 'pilihan_b', NULL, '2021-06-21 06:08:25', '2021-06-21 06:08:25'),
(17, 7, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">T.H.I.N.K dalam konsep kewargaan digital adalah tata krama untuk menjadi kewargaan digital yang baik dan benar. \"I\" merupakan akronim dari...</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Inspiring</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Invite</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Impossible</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Ignore</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Interesting</span><br></p>', 'pilihan_a', NULL, '2021-06-21 06:09:23', '2021-06-21 06:09:23'),
(18, 7, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Apakah berita yang dibagikan adalah benar dan fakta? atau berita tersebut adalah berita palsu atau hoax? sebelum membagikan informasi pastikan berita tersebut adalah berita yang sudah jelas kebenarannya sehingga tidak membuat pengguna sosial media lainnya bingung.Pernyataan diatas merupakan akronim dari salah 1 THINK adalah..</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">T = True</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">H = Helpful</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">I = Inspiring</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">N = Necessary</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">K = Kind</span><br></p>', 'pilihan_a', NULL, '2021-06-21 06:10:18', '2021-06-21 06:10:18'),
(20, 7, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Proses penyampaian pikiran atau gagasan dari seseorang ke orang lain yang dilakukan melalui dunia maya merupakan komunikasi…</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Komunikasi verbal</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Komunikasi non verbal</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Komunikasi dalam jaringan (online)</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Komunikasi Sinkron</span><br></p>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px;\">Komunikasi Asinkron</span><br></p>', 'pilihan_c', NULL, '2021-06-21 06:11:54', '2021-06-21 06:11:54'),
(21, 7, '<p><span style=\"color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, Roboto, Helvetica, Arial, sans-serif; letter-spacing: 0.1px;\">Komponen-komponen pendukung komunikasi dalam jaringan (daring/online) meliputi : perangkat keras (hardware), perangkat lunak (software) dan perangkat nalar atau akal (brainware). Program aplikasi/ software yang biasa digunakan dalam pelaksanaan komunikasi daring adalah...</span><br></p>', '<div class=\"freebirdFormviewerComponentsQuestionRadioChoice freebirdFormviewerComponentsQuestionRadioOptionContainer\" style=\"display: flex; width: 582px; min-height: 24px; padding-top: 0.5em; padding-right: 0.5em; padding-bottom: 0.5em;\"><label for=\"i81\" class=\"docssharedWizToggleLabeledContainer freebirdFormviewerComponentsQuestionRadioRadio\" style=\"display: flex; flex-direction: row; -webkit-box-flex: 1; flex-grow: 1; -webkit-box-pack: justify; justify-content: space-between; width: 582px;\"><div class=\"docssharedWizToggleLabeledLabelWrapper exportLabelWrapper\" style=\"-webkit-box-align: center; align-items: center; display: flex; flex-shrink: 1; min-width: 0%;\"><div class=\"docssharedWizToggleLabeledContent\" style=\"display: flex; flex-direction: column; -webkit-box-flex: 1; flex-grow: 1; -webkit-box-pack: center; justify-content: center; margin-left: 0.75em; min-width: 0%;\"><div class=\"docssharedWizToggleLabeledPrimaryText\" style=\"-webkit-box-align: center; align-items: center; display: flex; min-width: 0%;\"><span dir=\"auto\" class=\"docssharedWizToggleLabeledLabelText exportLabel freebirdFormviewerComponentsQuestionRadioLabel\" style=\"font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px; line-height: 20px; color: rgb(32, 33, 36); min-width: 1px;\"><span style=\"letter-spacing: 0.2px;\">PC, HP, headset, microphone dan perangkat pendukung koneksi Internet</span><br></span></div></div></div></label></div>', '<p><span style=\"color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-seri